import React, { useState, useEffect } from 'react';

export default function OwnerDashboard() {
    const [cars, setCars] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Fetch the cars data from an API or database
        fetch('/api/cars')
            .then(response => response.json())
            .then(data => {
                setCars(data);
                setLoading(false);
            });
    }, []);

    if (loading) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h2>Owner Dashboard</h2>
            <nav>
                <ul>
                    <li><a href="#ongoing-bookings">All Ongoing Bookings</a></li>
                    <li><a href="#new-bookings">New Bookings</a></li>
                    <li><a href="#cars-servicing">Cars Under Servicing</a></li>
                </ul>
            </nav>
            <div id="ongoing-bookings">
                <h3>Ongoing Bookings</h3>
                <ul>
                    {cars.filter(car => car.status === 'ongoing').map(car => (
                        <li key={car.id}>
                            {car.make} {car.model} - {car.year}
                        </li>
                    ))}
                </ul>
            </div>
            <div id="new-bookings">
                <h3>New Bookings</h3>
                <ul>
                    {cars.filter(car => car.status === 'new').map(car => (
                        <li key={car.id}>
                            {car.make} {car.model} - {car.year}
                        </li>
                    ))}
                </ul>
            </div>
            <div id="cars-servicing">
                <h3>Cars Under Servicing</h3>
                <ul>
                    {cars.filter(car => car.status === 'servicing').map(car => (
                        <li key={car.id}>
                            {car.make} {car.model} - {car.year}
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}
